import React, { useEffect, useState } from "react";
import { useNavigate } from 'react-router-dom'
import axios from "axios";

//https://649cf38a9bac4a8e669d1b36.mockapi.io/todolist

function Home() {

  const navigate = useNavigate()

  const [users, setUsers] = useState()

  useEffect(() => {
    const dataRegister = JSON.parse(localStorage.getItem("dataRegister"))
    if (!dataRegister) {
      navigate('register')
    }
  }, [])

  useEffect(() => {
    const res = axios.get("https://649cf38a9bac4a8e669d1b36.mockapi.io/todolist")
    res.then((data) => setUsers(data.data))
  }, [])

  console.log('============= users', users)

  return (<TableContainer component={Paper}>
    <Table sx={{ minWidth: 650 }} aria-label="simple table">
      <TableHead>
        <TableRow>
          <TableCell>Dessert (100g serving)</TableCell>
          <TableCell align="right">Calories</TableCell>
          <TableCell align="right">Fat&nbsp;(g)</TableCell>
          <TableCell align="right">Carbs&nbsp;(g)</TableCell>
          <TableCell align="right">Protein&nbsp;(g)</TableCell>
        </TableRow>
      </TableHead>
      <TableBody>
        {users.map((user) => (
          <TableRow
            key={row.name}
            sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
          >
            <TableCell component="th" scope="row">
              {row.name}
            </TableCell>
            <TableCell align="right">{row.calories}</TableCell>
            <TableCell align="right">{row.fat}</TableCell>
            <TableCell align="right">{row.carbs}</TableCell>
            <TableCell align="right">{row.protein}</TableCell>
          </TableRow>
        ))}
      </TableBody>
    </Table>
  </TableContainer>)
}

export default Home;
